import React from "react";
import "./App.css";
import NavBar from "./component/navBar.jsx";
import Background from "./component/background.jsx";
import About from "./component/about.jsx";
import Skills from "./component/skills";
import Portfolio from "./component/portfolio.jsx";
import Contact from "./component/contact.jsx";
import Footer from "./component/footer.jsx";
import {VerticleButton as ScrollUpButton} from "react-scroll-up-button";
const { lazy, Suspense } = React;

const Lazy = lazy(() => new Promise(resolve => {
  setTimeout(() => {
    resolve({ default: () => <Background /> });
  }, 4000);
}));


function App() {
  return (
    <Suspense fallback={ <div id="container">
    <div class="sphere s-gold"></div>
    <div class="sphere s-5"></div>
    <div class="sphere s-4"></div>
    <div class="sphere s-3"></div>
    <div class="sphere s-2"></div>
    <div class="sphere s-1"></div>
</div> }>
    <div className="App">
      <NavBar />

      <About />
      <Skills />
      <Portfolio />
      <Contact />
      <Footer />
      <ScrollUpButton/>
      <Lazy/>
    </div>
    </Suspense>
  );
}

export default App;
